import React from "react";
import ReactDOM from "react-dom";
import cars from "./practice"; 

const [honda, tesla] = cars;
const { speedStats: { topSpeed: hondaTopSpeed }, coloursByPopularity: [hondaTopColor] } = honda;
const { speedStats: { topSpeed: teslaTopSpeed }, coloursByPopularity: [teslaTopColor] } = tesla;

ReactDOM.render(
  <table>
    <thead>
      <tr>
        <th>Brand</th>
        <th>Top Speed</th>
        <th>Top Colour</th>
      </tr>
    </thead>
    <tbody>
      {cars.map((car, index) => (
        <tr key={index}>
          <td>{car.model}</td>
          <td>{car.speedStats.topSpeed} mph</td> {/* Accessing topSpeed from speedStats */}
          <td>{car.coloursByPopularity[0]}</td> {/* Accessing the first colour from coloursByPopularity */}
        </tr>
      ))}
    </tbody>
  </table>,
  document.getElementById("root")
);
